import org.junit.Before;
import org.junit.Test;

import java.util.ArrayList;
import java.util.Collections;
import java.util.List;

public class EncontrarCaracterMaisFrequenteTest {

    String palavra;

    @Before
    public void setUp() {
        palavra = "";
    }

    @Test
    public void testarEncontrarCaracterMaisFrequenteIngenuo(){
        EncontrarCaracterMaisFrequente.encontrarCaracterMaisFrequenteIngenuo(palavra);
    }

    @Test
    public void testarEncontrarCaracterMaisFrequenteEsperto(){
        EncontrarCaracterMaisFrequente.encontrarCaracterMaisFrequenteEsperto(palavra);
    }

    @Test
    public void testarEncontrarCaracterMaisFrequentePerformances(){
        double t1 = System.currentTimeMillis();
        EncontrarCaracterMaisFrequente.encontrarCaracterMaisFrequenteIngenuo(palavra);
        double t2 = System.currentTimeMillis();
        double tf = (t2-t1)/1000;
        System.out.printf("A execução usando o Ingenuo demorou %.15f segundos.\n",tf);

        t1 = System.currentTimeMillis();
        EncontrarCaracterMaisFrequente.encontrarCaracterMaisFrequenteEsperto(palavra);
        t2 = System.currentTimeMillis();
        tf = (t2-t1)/1000;
        System.out.printf("A execução usando o Esperto demorou %.15f segundos.\n",tf);
    }

}
